}
/* section header */
.header {
  background: linear-gradient(
      360deg,
      rgba(237, 215, 137, 0.9) 0%,
      rgba(233, 130, 131, 0.9) 100%
    ),
    url("/41bb353c70fc086c251607627c6532e9.jpg");
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
}
.header__nav {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 77px;
}
.header__menu {
  display: flex;
}
.header__menu ul {
  display: flex;
}
.header__menu ul li {
  height: 100px;
}
.header__menu li a {
  padding: 0 30px;
  display: flex;
  align-items: center;
  height: 80%;
  font-weight: 600;
  font-size: 14px;
  line-height: 16px;
  text-align: center;
  text-transform: uppercase;
  color: #ffffff;
  position: relative;
}
.header__menu li.active a {
  color: #f4bf87;
}
.header__menu li.active a:after {
  background-color: #f4bf87;
  width: 100%;
}
.header__menu li:hover a:after {
  width: 100%;
}
.header__menu li a:after {
  content: "";
  display: block;
  clear: both;
  height: 3px;
  width: 0;
  position: absolute;
  background-color: #f4bf87;
  left: 0;
  bottom: 0;
  transition: all 0.6s ease-in-out;
}
.header__nav-ico {
  display: flex;
  align-items: center;
}
.header__nav-ico .ico {
  display: block;
  width: 24px;
  height: 24px;
  background-repeat: no-repeat;
  background-position: center;
  background-size: contain;
}
.ico {
  width: 100%;
}
.header__nav-ico a {
  height: 50%;
  padding: 0 30px;
}
.ico-basket {
  background-image: url("/2d66299b3383180f4f98c2dd35d5b59e.svg");
}
.ico-basket:hover {
  background-image: url("/c73e13403250da8f8dbcda42d2e3ac9d.svg");
  cursor: pointer;
}
.ico-search {
  background-image: url("/dbc5160066cc43146193e81ff1252315.svg");
}
.ico-search:hover {
  background-image: url("/16fe08afa162e023720da9ca11812176.svg");
  cursor: pointer;
}
/* hidden menu */
.hidden-menu {
  display: none;
}
.hidden-menu {
  width: 24px;
  height: 18px;
  z-index: 2;
}
.hidden-menu input {
  display: none;
  opacity: 0;
  z-index: 2;
}
.hidden-menu label {
  position: absolute;
  top: 20px;
  right: 20px;
  width: 24px;
  height: 18px;
  display: block;
  z-index: 15;
}
.hidden-menu .linear {
  background: white;
  display: block;
  width: 100%;
  height: 3px;
  border-radius: 1px;
  transition: all 0.5s;
}
.hidden-menu .linear:not(:last-child) {
  margin-bottom: 3px;
}
.hidden-menu input:checked + label span {
  background-color: #fff;
  opacity: 1;
  transform: translateY(6px) translateX(0) rotate(45deg);
}
.hidden-menu input:checked + label span.linear2 {
  opacity: 0;
}
.hidden-menu input:checked + label span.linear3 {
  transform: translateY(-6px) translateX(0) rotate(-45deg);
}
.hidden-menu input:checked ~ .sidebar {
  height: 700px;
  top: 0;
  transition: all 0.6s ease;
}
.hidden-menu input:checked ~ .sidebar .nav-toggle {
  animation: listnav 4s linear 1;
}
@keyframes listnav {
  0% {
    transform: scale(0);
    transition: all 0.5s ease-in-out;
  }
  25% {
    transform: scale(1.4);
    transition: all 0.4s ease-in-out;
  }
  50% {
    transform: scale(1.6);
    transition: all 0.3s ease-in-out;
  }
  75% {
    transform: scale(1.8);
    transition: all 0.2s ease-in-out;
  }
  100% {
    transform: scale(1.1);
    transition: all 0.5s ease-in-out;
  }
}
.sidebar {
  padding-top: 28px;
  position: absolute;
  z-index: 5;
  width: 100%;
  top: -100%;
  left: 0;
  background: linear-gradient(
      360deg,
      rgba(237, 215, 137, 0.9) 0%,
      rgba(233, 130, 131, 0.9) 100%
    ),
    url("/41bb353c70fc086c251607627c6532e9.jpg");
