  align-items: center;
}
summary::after {
  content: "";
  display: block;
  clear: both;
  background-image: url("/14b1ce1a83a5f9127954d3af3dcd1a14.svg");
  background-repeat: no-repeat;
  background-size: contain;
  width: 42px;
  height: 42px;
  position: absolute;
  top: 21px;
  right: 14px;
  cursor: pointer;
}
details[open] > summary {
  display: flex;
  align-items: center;
  padding-bottom: 20px;
  border-bottom: 1px solid #c6cbcd;
  transition: all 0.4s ease;
}

details[open] > summary::after {
  content: "";
  display: block;
  clear: both;
  background-image: url("/519966ae84ca63b43a7cf1495551b827.svg");
