* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}
body {
  color: white;
  font-family: "Raleway", "sans-serif";
  font-size: 16px;
}
.container {
  width: 1200px;
  margin: 0 auto;
  padding: 0 15px;
}
ul {
  list-style-type: none;
}
a,
img {
  border: 0;
  outline: 0;
}
a {
  text-decoration: none;
}
.line {
  width: 170px;
  border: 2px solid #f38281;
  margin: 0 auto 45px;
}
.separator {
  border: 2px solid #f38281;
  width: 70px;
  margin-right: 56px;
}
.button {
  font-family: "Raleway", "sans-serif";
  font-weight: 700;
  text-transform: uppercase;
  text-align: center;
  color: #ffffff;
  cursor: pointer;
}
h4 {
  font-family: "Kaushan Script", "sans-serif";
  font-weight: 400;
  font-size: 30px;
  line-height: 44px;
  text-align: center;
  color: #2d3033;
}
h5 {
  font-family: "Raleway", "sans-serif";
  font-weight: 700;
  font-size: 24px;
  line-height: 28px;
  text-transform: uppercase;
  color: #2d3033;
}
h6 {
  font-family: "Raleway", "sans-serif";
  font-weight: 400;
  font-size: 13px;
  line-height: 15px;
  color: #2d3033;
}
p {
  font-family: "Raleway", "sans-serif";
  font-weight: 400;
  font-size: 18px;
  line-height: 21px;
  text-align: left;
  color: #2d3033;
}
.title {
  font-family: "Kaushan Script", "sans-serif";
  font-weight: 400;
  font-size: 30px;
  line-height: 44px;
  text-align: center;
  color: #2d3033;
  margin-bottom: 50px;
}
.subtitle {
  font-family: "Raleway", "sans-serif";
  font-weight: 900;
  font-size: 36px;
  line-height: 42px;
  text-transform: uppercase;
  text-align: center;
  color: #2d3033;
  margin-bottom: 52px;
}
.text {
  font-family: "Raleway", "sans-serif";
  font-weight: 400;
  font-size: 18px;
  line-height: 21px;
  text-align: center;
  color: #000000;
  margin-bottom: 85px;
}
/* section header */
.header {
  background: linear-gradient(
      360deg,
      rgba(237, 215, 137, 0.9) 0%,
      rgba(233, 130, 131, 0.9) 100%
    ),
    url("./assets/bkgbanner.jpg");
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
}
.header__nav {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 77px;
}
.header__menu {
  display: flex;
}
.header__menu ul {
  display: flex;
}
.header__menu ul li {
  height: 100px;
}
.header__menu li a {
  padding: 0 30px;
  display: flex;
  align-items: center;
  height: 80%;
  font-weight: 600;
  font-size: 14px;
  line-height: 16px;
  text-align: center;
  text-transform: uppercase;
  color: #ffffff;
  position: relative;
}
.header__menu li.active a {
  color: #f4bf87;
}
.header__menu li.active a:after {
  background-color: #f4bf87;
  width: 100%;
}
.header__menu li:hover a:after {
  width: 100%;
}
.header__menu li a:after {
  content: "";
  display: block;
  clear: both;
  height: 3px;
  width: 0;
  position: absolute;
  background-color: #f4bf87;
  left: 0;
  bottom: 0;
  transition: all 0.6s ease-in-out;
}
.header__nav-ico {
  display: flex;
  align-items: center;
}
.header__nav-ico .ico {
  display: block;
  width: 24px;
  height: 24px;
  background-repeat: no-repeat;
  background-position: center;
  background-size: contain;
}
.ico {
  width: 100%;
}
.header__nav-ico a {
  height: 50%;
  padding: 0 30px;
}
.ico-basket {
  background-image: url("./assets/basket.svg");
}
.ico-basket:hover {
  background-image: url("./assets/baskethover.svg");
  cursor: pointer;
}
.ico-search {
  background-image: url("./assets/search.svg");
}
.ico-search:hover {
  background-image: url("./assets/searchhover.svg");
  cursor: pointer;
}
/* hidden menu */
.hidden-menu {
  display: none;
}
.hidden-menu {
  width: 24px;
  height: 18px;
  z-index: 2;
}
.hidden-menu input {
  display: none;
  opacity: 0;
  z-index: 2;
}
.hidden-menu label {
  position: absolute;
  top: 20px;
  right: 20px;
  width: 24px;
  height: 18px;
  display: block;
  z-index: 15;
}
.hidden-menu .linear {
  background: white;
  display: block;
  width: 100%;
  height: 3px;
  border-radius: 1px;
  transition: all 0.5s;
}
.hidden-menu .linear:not(:last-child) {
  margin-bottom: 3px;
}
.hidden-menu input:checked + label span {
  background-color: #fff;
  opacity: 1;
  transform: translateY(6px) translateX(0) rotate(45deg);
}
.hidden-menu input:checked + label span.linear2 {
  opacity: 0;
}
.hidden-menu input:checked + label span.linear3 {
  transform: translateY(-6px) translateX(0) rotate(-45deg);
}
.hidden-menu input:checked ~ .sidebar {
  height: 700px;
  top: 0;
  transition: all 0.6s ease;
}
.hidden-menu input:checked ~ .sidebar .nav-toggle {
  animation: listnav 4s linear 1;
}
@keyframes listnav {
  0% {
    transform: scale(0);
    transition: all 0.5s ease-in-out;
  }
  25% {
    transform: scale(1.4);
    transition: all 0.4s ease-in-out;
  }
  50% {
    transform: scale(1.6);
    transition: all 0.3s ease-in-out;
  }
  75% {
    transform: scale(1.8);
    transition: all 0.2s ease-in-out;
  }
  100% {
    transform: scale(1.1);
    transition: all 0.5s ease-in-out;
  }
}
.sidebar {
  padding-top: 28px;
  position: absolute;
  z-index: 5;
  width: 100%;
  top: -100%;
  left: 0;
  background: linear-gradient(
      360deg,
      rgba(237, 215, 137, 0.9) 0%,
      rgba(233, 130, 131, 0.9) 100%
    ),
    url("./assets/bkgbanner.jpg");
  background-size: cover;
  background-repeat: no-repeat;
  background-position: center;
}
.nav-toggle {
  padding-top: 30px;
}
.sidebar ul li {
  text-align: center;
  padding: 25px 0;
}
.sidebar ul li a {
  font-weight: 700;
  font-size: 13px;
  line-height: 15px;
  text-transform: uppercase;
  color: #ffffff;
}
.header__banner {
  display: flex;
  flex-direction: column;
  align-items: center;
}
h2 {
  font-family: "Kaushan Script", "sans-serif";
  font-size: 64px;
  line-height: 93px;
  text-align: center;
  color: #ffffff;
  margin-bottom: 70px;
}
h1 {
  font-family: "Montserrat", "sans-serif";
  font-weight: 700;
  font-size: 144px;
  line-height: 176px;
  text-align: center;
  text-transform: uppercase;
  color: #ffffff;
  margin-bottom: 84px;
}
.divider {
  border: 4px solid #ffffff;
  width: 170px;
  margin: 0 auto 72px;
}
.button-learn {
  width: 300px;
  height: 60px;
  font-size: 24px;
  line-height: 28px;
  border: 2px solid #ffffff;
  background-color: transparent;
  margin-bottom: 116px;
}
.button-learn:hover {
  color: #e4be8d;
  background: #ffffff;
}
.button-learn:active {
  color: #e4be8d;
  background: #ffffff;
  border: 4px solid #e4be8d;
}
.header__slider ul {
  display: flex;
}
.header__slider li a {
  display: block;
  height: 100%;
  width: 270px;
  padding: 30px 0;
  border-top: 4px solid #f9efcf;
  font-family: "Raleway", "sans-serif";
  font-weight: 500;
  font-size: 18px;
  line-height: 21px;
  text-transform: uppercase;
  text-align: left;
  color: #f9efcf;
  position: relative;
}
.header__slider li:hover a:after {
  width: 30%;
  height: 4px;
  top: -4px;
