  width: 24px;
  height: 24px;
  background-repeat: no-repeat;
  background-position: center;
  background-size: contain;
  margin-right: 11px;
}
.ico-footerfacebook {
  background-image: url("./assets/footerfacebook.svg");
}

.ico-footertwitter {
