}
.ico-footerinstagram {
  background-image: url("./assets/footerinstagram.svg");
}
.ico-footerpinterest {
  background-image: url("./assets/footerpinterest.svg");
}
.ico-footerlinkedin {
  background-image: url("./assets/linkedin.svg");
}
.ico-footeryoutube {
  background-image: url("./assets/youtube.svg");
}
.ico-footerdribble {
