.fieldset {
  display: flex;
  border: none;
  height: 55px;
}
*:focus {
  outline: none !important;
}
input {
  border-top: 1px solid #c6cbcd;
  border-bottom: 1px solid #c6cbcd;
  border-left: 1px solid #c6cbcd;
  border-right: none;
  font-family: inherit;
  font-weight: 400;
  font-size: 18px;
  line-height: 21px;
  text-align: center;
  color: black;
  width: 64%;
}
input::placeholder {
